// StateList.js

import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const StateList = () => {
  const [stateList] = useState([
    // Your state data...
  ]);

  return (
    <div>
      <h2>State List</h2>
      <ul>
        {stateList.map((state) => (
          <li key={state._id}>
            {state.name} -{' '}
            <Link to={`/state/${state._id}`}>Click Here</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default StateList;
